pragma solidity ^0.8.10;

import "./CDeposit.sol";
import "./CBorrow.sol";


contract CLendingManager is CBorrow, CDeposit{

    function applyForCreditInterface(address borrower, uint256 amount) public {
        applyForCredit(borrower, amount);
    }

    function getApplicationsInterface() public view returns (Credit[] memory) {
        return getApplications();
    }

    // Function to get the current count
    function getDepositBalanceInterface() public view returns (uint) {
        return getDepositBalance();
    }

    function depositAmountInterface() public payable {
        depositAmount();
    }

}
